import React from 'react';
import { Link } from 'react-router-dom'; // For navigation

const NavLinks = () => {
  return (
    <div style={styles.navContainer}>
      <h3 style={styles.header}>Navigation</h3>
      <ul style={styles.navList}>
        <li style={styles.navItem}>
          <Link to="/" style={styles.link}>Home</Link>
        </li>
        <li style={styles.navItem}>
          <Link to="/StudentHome" style={styles.link}>Student Home</Link>
        </li>
        <li style={styles.navItem}>
          <Link to="/MarkView" style={styles.link}>Student Marks</Link>
        </li>
        <li style={styles.navItem}>
          <Link to="/courses" style={styles.link}>Courses</Link>
        </li>
        <li style={styles.navItem}>
          <Link to="/about" style={styles.link}>About</Link>
        </li>
      </ul>
    </div>
  );
};

const styles = {
  navContainer: {
    backgroundColor: '#333',
    padding: '20px',
    borderRadius: '8px',
    color: '#fff',
    width: '250px',
    position: 'fixed',
    top: '20px',
    left: '20px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
  },
  header: {
    textAlign: 'center',
    marginBottom: '20px',
    fontSize: '1.5em',
  },
  navList: {
    listStyleType: 'none',
    padding: 0,
  },
  navItem: {
    marginBottom: '10px',
  },
  link: {
    color: '#fff',
    textDecoration: 'none',
    fontSize: '1.1em',
    transition: 'color 0.3s ease',
  },
};

export default NavLinks;
